import React from "react";


function Heading(){
    return(
        <header>
        <nav class="navbar">
            <ul class="nav-options">
                <a href="#home"><li class="nav-item">Home</li></a>
                <a href="#projetos"><li class="nav-item">Projetos</li></a>
                <a href="#skills"><li class="nav-item">Guias</li></a>
                <a href="https://www.figma.com/file/s9Z908sPoAvhRyBKdFN1zl/Takan?node-id=0%3A1" target="_blank"><li class="nav-item">Figma</li></a> 
                <a href="https://github.com/wpcavalcante"><li class="nav-item">Sobre</li></a>
            </ul>
        </nav>
        </header>
    )
}

export default Heading;
